import React, { useEffect, useState } from "react";

function App() {
  const [backendData, setBackendData] = useState([{}]);

  useEffect(() => {
    fetch("/user/api").then(
      ((response) => response.json()).then((data) => {
        setBackendData(data);
      })
    );
  });

  return <div>App</div>;
}

export default App;
